import React, { Component } from 'react';
import logo from '../svg/logo.svg';
import '../css/App.css';
import NavBar from '../js/NavBar';
import Footer from '../js/Footer';
import About from '../js/About';
import ScrollableAnchor from 'react-scrollable-anchor';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header><NavBar/></header>
        <img src={logo} className="App-logo" alt="logo"/>
        <about><About/></about>

        <about className="App-middle">
          <div className="InLine">
            <h7>FOR ADDITIONAL INFORMATION:
              <a
                className="App-link"
                href="https://docs.google.com/document/d/177EnbipKrSDezdCW10ok0LZR79PuPTtBrqViSfJT_ZU/"
                target="_blank"
                rel="noopener noreferrer"> HERE IS MY CV.
              </a>
            </h7>
            <p className="App-relocate">FREE TO HIRE AND RELOCATE.</p>
          </div>
        </about>

        <work>
        </work>

        <ScrollableAnchor id={'contact'}>
          <Footer />
        </ScrollableAnchor>
      </div>
    );
  }
}

export default App;
